import React from 'react';
import './Home.scss';

const Home = () => {
	return (
		<div>
			<div className='home'>
				<div className='home-image'>
					<h1>Welcome to 96th Ave.</h1>
				</div>
			</div>
		</div>
	);
};

export default Home;
